import React from 'react';
import avatar from './../../assets/img/ava.jpg'




const PopUpMessage = ({user}) => {
    return <div>
        <img src={user.photos.small != null ? user.photos.small : avatar} alt="" className={styles.usersAvatar} />
    </div>
}
export default PopUpMessage;
